// src/components/TeamSection.js
import React from 'react';
import TeamMember from './TeamMember';

const teamMembersStyle1 = [
  {
    name: 'Adveon Desuza',
    role: 'UI Designer',
    image: 'https://source.unsplash.com/90x90?face',
  },
  {
    name: 'Jezmin Uniya',
    role: 'Product Designer',
    image: 'https://source.unsplash.com/100x100?face',
  },
  {
    name: 'Andrieo Gloree',
    role: 'App Developer',
    image: 'https://source.unsplash.com/95x95?face',
  },
  {
    name: 'Jackie Sanders',
    role: 'Content Writer',
    image: 'https://source.unsplash.com/85x85?face',
  },
];

const teamMembersStyle2 = [
  {
    name: 'Matheus Ferrero',
    role: 'Marketing Expert',
    image: 'https://source.unsplash.com/80x80?face',
  },
  {
    name: 'Stuard Ferrel',
    role: 'Digital Marketer',
    image: 'https://source.unsplash.com/75x75?face',
  },
  {
    name: 'Eva Hudson',
    role: 'Creative Designer',
    image: 'https://source.unsplash.com/105x105?face',
  },
  {
    name: 'Jackie Sanders',
    role: 'SEO Expert',
    image: 'https://source.unsplash.com/110x110?face',
  },
];

const TeamSection = () => {
  return (
    <div className="p-8">
      <h2 className="text-2xl font-bold mb-4">Friends</h2>
      
      <div className="mb-8">
        <h3 className="text-xl font-semibold mb-4">Style 1</h3>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4">
          {teamMembersStyle1.map((member, index) => (
            <TeamMember key={index} {...member} styleType="Style1" />
          ))}
        </div>
      </div>

      <div>
        <h3 className="text-xl font-semibold mb-4"></h3>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4">
          {teamMembersStyle2.map((member, index) => (
            <TeamMember key={index} {...member} styleType="Style2" />
          ))}
        </div>
      </div>
    </div>
  );
};

export default TeamSection;
